import React from 'react';
import { Chrono } from "react-chrono";

import Sidebar from './components/sidebar'
import Introduction from "./components/introduction";
import Projects from "./components/projects";
import Placeholder from "./components/placeholder";
import Timeline from "./components/timeline";

import './css/style.css'

import image from './public/images/intro_pic_jeremy.jpeg'


const items = [{
    title: "May 1940",
    contentTitle: "Dunkirk",
    contentText:"Men of the British Expeditionary Force (BEF) wade out to a destroyer during the evacuation from Dunkirk.",
    contentDetailedText: "On 10 May 1940, Hitler began his long-awaited offensive in the west...",
}];
function App() {
  return (

    <div className="App">
      <div className="wrapper">
          <div id="outter">
              <div id="image"><img className="bg-image" src={image} /></div>
              <div id="contentOutter">
                  <Sidebar></Sidebar>
                  <Introduction></Introduction>
                  <Projects></Projects>
                  <div style={{ width: "100%", height: "500px" }}>
                      <Chrono items={items} mode="HORIZONTAL" />
                  </div>
                  <Placeholder></Placeholder>
                  <Timeline></Timeline>
              </div>
          </div>

      </div>
    </div>
  );
}

export default App;
